-- ----------------------------
-- View structure for word_sentence_count
-- ----------------------------
DROP VIEW IF EXISTS `word_sentence_count`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `word_sentence_count` AS select `word`.`word_id` AS `word_id`,`word`.`word` AS `word`,count(`sentence`.`sentence`) AS `sentencecount` from ((`word` join `instance`) join `sentence`) where ((`word`.`word_id` = `instance`.`word_id`) and (`instance`.`sentence_id` = `sentence`.`sentence_id`)) group by `word`.`word`;

-- ----------------------------
-- View structure for word_translation_count
-- ----------------------------
DROP VIEW IF EXISTS `word_translation_count`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `word_translation_count` AS select `word`.`word_id` AS `word_id`,`word`.`word` AS `word`,count(`translation`.`translation`) AS `translationcount` from ((`word` join `translate`) join `translation`) where ((`word`.`word_id` = `translate`.`word_id`) and (`translation`.`trans_id` = `translate`.`trans_id`)) group by `word`.`word`;

-- ----------------------------
-- Procedure structure for word_sentence
-- ----------------------------
DROP PROCEDURE IF EXISTS `word_sentence`;
delimiter ;;
CREATE PROCEDURE `word_sentence`(in searchword varchar(40))
  DETERMINISTIC
BEGIN
	SELECT `word`, `sentence` 
	from `instance` ,word, `sentence` 
	WHERE `instance`.`word_id` = `word`.`word_id` and `instance`.`sentence_id` = `sentence`.`sentence_id` and `word`.`word` = searchword;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for word_translation
-- ----------------------------
DROP PROCEDURE IF EXISTS `word_translation`;
delimiter ;;
CREATE PROCEDURE `word_translation`(in searchWord varchar(40))
  DETERMINISTIC
BEGIN
	SELECT translation as 
	FROM `word`, `translate`,  `translation`
	WHERE `word`.`word_id` = `translate`.`word_id` and `translation`.`trans_id` = `translate`.`trans_id` and `word`.`word` = searchWord;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table translation
-- ----------------------------
DROP TRIGGER IF EXISTS `translation_update`;
delimiter ;;
CREATE TRIGGER `translation_update` BEFORE UPDATE ON `translation` FOR EACH ROW begin
    if not exists (select translation from translation where translation.translation = new.translation) then
        set new.translation = old.translation;
    end if;
end
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table word
-- ----------------------------
DROP TRIGGER IF EXISTS `word_update`;
delimiter ;;
CREATE TRIGGER `word_update` BEFORE UPDATE ON `word` FOR EACH ROW begin
    if not exists (select word from word where word.word = new.word) then
        set new.word = old.word;
    end if;
end
;;
delimiter ;

